INSERT INTO `activity` VALUES ('1121084149168381954', '电影阿凡达交流会我对球队期望达到', '鹅城音乐厅B门', '一切都被颠倒了，仿佛那里才是真实的世界，这里才是梦。\n生命是甜美的，而且，生命如此甜美。', '/img_20190428123031.jpg', '2019-05-07 00:00:00', '2019-05-09 00:00:00', '2019-05-09 00:00:00', '2019-05-10 00:00:00', '', '0', '1121077918697631746', '100', '1', '1', null, '2019-04-25 00:11:05', '111111', '2019-05-07 20:56:22', '111111');
