INSERT INTO `activity` VALUES ('1125722814100299777', '抓紧时间，生存大挑战报名开始啦', '惠州学院各站点', '        惠州学院第二十一届科技文化艺术节之第十三届“5.25”心理教育主题活动之第四届“生存大挑战”报名通道即将开通！\n        ', '/img_20190507190906.jpg', '2019-05-07 00:00:00', '2019-05-09 00:00:00', '2019-05-11 00:00:00', '2019-05-12 00:00:00', '', '3', '1121077918697631746', '150', '1', '1', null, '2019-05-07 19:23:28', '111111', '2019-05-09 00:00:00', 'System');
INSERT INTO `activity` VALUES ('1126096175267639297', '教育评估竞赛即将开始！', '旭日大楼104、106、409', '为进一步让我院学生加强对校情的认识，深入了解审核评估精神和内涵，意识到此次本科教学工作审核评估的重要性，我院将于4月26日至4月28日在旭日大楼104、106、409等多媒体教室举行“教育评估，我担当我作为”系列活动之教育评估知识竞赛。', '/img_20190508195744.jpg', '2019-04-21 00:00:00', '2019-04-23 00:00:00', '2019-04-26 00:00:00', '2019-04-28 00:00:00', '', '4', '1121077918697631746', '100', '1', '1', null, '2019-05-08 20:07:05', '111111', '2019-05-09 11:47:20', 'System');
INSERT INTO `activity` VALUES ('1126101400183435265', '科技文化艺术节之职场连连看', '旭日303', '为提升我校学生的就业能力，学会自我审视，让学生更好地适应社会发展，培养广大在校生的求职力和竞争力，提前感受职场招聘的氛围，由教务处、学生处、团委主办，数学与大数据学院承办的第二十一届科技文化艺术节之职场连连看活动，开始报名啦！希望大家踊跃报名!秀出职场上的你！（活动面向全校大一至大三学生）', '/img_20190509231121.jpg', '2019-05-10 00:00:00', '2019-05-12 00:00:00', '2019-05-13 00:00:00', '2019-05-14 00:00:00', '', '2', '1121077918697631746', '100', '1', '1', null, '2019-05-08 20:27:50', '111111', '2019-05-09 23:11:37', '111111');
INSERT INTO `activity` VALUES ('1126491568732119041', '猫的报恩观影趴', '鹅城音乐厅', '吉冈春是一个普普通通同时又有些迷糊的女高中生，某天放学的路上，她偶然救下了一只险些丧生车轮之下的小猫，谁曾想小猫竟然直立起来以人类的方式对女孩表示感谢。小春更想不到的是，她不经意的善举改变了自己的命运。原来小猫是猫王国的王子，为了报答小春的恩情，猫王国举国上下展开了令人啼笑皆非的报恩行动，只不过它们视为“上品”的老鼠令小春哭笑不得。不久后，小春接受王国的邀请前去做客，期间竟稀里糊涂答应成为王子的妃子。女孩眼看就彻底变成了一只猫，神秘的男爵成为她的救命稻草……', '/img_20190509230039.png', '2019-05-10 00:00:00', '2019-05-11 00:00:00', '2019-05-11 08:00:00', '2019-05-11 10:00:00', '', '2', '1126025251751317505', '100', '1', '1', null, '2019-05-09 22:18:14', '1126025926648385538', '2019-05-09 23:00:49', '1126025926648385538');
INSERT INTO `activity` VALUES ('1126495673261236226', '心理情景剧 — 终局之战', '鹅城会议厅', '心理情景剧在我们惠州学院已有长达十年的历史，今年举办到了第十一届。作为“5.25”心理健康月的子活动之一，心理情景剧深受老师和同学们的重视。\n当你来到第十一届心理情景剧决赛现场，将可以看到精湛的演技、矛盾不已的内心戏等等，剧情不仅精彩好看而且发人深省，还有很多好看的小哥哥小姐姐哦。\n想要了解更多，那就快来报名，观看心理情景剧决赛。不仅可以认证1个心理学时，还有机会获得神秘大礼哦！', '/img_20190509230438.jpg', '2019-05-09 00:00:00', '2019-05-11 00:00:00', '2019-05-13 18:30:00', '2019-05-13 22:00:00', '', '2', '1126025251751317505', '100', '1', '1', null, '2019-05-09 22:34:32', '1126025926648385538', '2019-05-09 23:04:49', '1126025926648385538');
